// src/DataManipulation/Header.js
import React from 'react';

const Header = ({ onMenuClick }) => {
  return (
    <header>
      <h1>Minha Aplicação</h1>
      <button onClick={onMenuClick}>Menu</button>
    </header>
  );
};

export default Header;
